webpackJsonp([0x66daeac22a89],{6579:function(e,t){e.exports={data:{post:{html:'<p>The Bundeswehr Hospital in Hamburg was supposed to be target of a <a title="NDR Online: Terrorismus - Terroranschlag auf Krankenhaus geplant" href="http://www.ndr.de/ndr/regional/detail_line.phtml?docid=20031230164945">car bomb terrorist attack</a>, according to the Interioir Ministry in Hamburg. The area around the hospital in Hamburg Wandsbek was sealed off this afternoon by police. ARD is reporting that the warning came from the US, namely the CIA. <a title="BBC NEWS | World | Europe | Security alert at German hospital" href="http://news.bbc.co.uk/1/hi/world/europe/3357553.stm">BBC</a>, <a title="NETZEITUNG: Anschlag auf Hamburger Bundeswehr-Krankenhaus geplant" href="http://www.netzeitung.de/spezial/kampfgegenterror/267089.html">Netzeitung</a>, <a title="heute.t-online.de - Terror-Alarm in Hamburg" href="http://www.heute.t-online.de/ZDFheute/artikel/3/0,1367,POL-0-2092899,00.html">ZDF</a> and <a title="n-tv.de - Anschlag in Hamburg vereitelt" href="http://www.n-tv.de/5201191.html">n-tv</a> also have the story.</p>',fields:{title:"Terror Alarm in Hamburg",date:"30 Dec 2003",url:"https://papascott.de/2003-12-30-terror-alarm-in-hamburg/"}}},pathContext:{slug:"/2003-12-30-terror-alarm-in-hamburg/",prev:{fields:{title:"Partytime",date:"28 Dec 2003",slug:"/2003-12-28-partytime/"}},next:{fields:{title:"SMS Spam Wanted",date:"31 Dec 2003",slug:"/2003-12-31-sms-spam-wanted/"}}}}}});
